INSERT INTO `news` (`Nid`, `nameNews`, `Detail`, `Pic`, `Date`) VALUES
(2, 'ผู้ใหญ่ใจดี จัดกิจกรรมเพื่อสังคมร่วมบริจาคเสื้อผ้า และสิ่งของที่จำเป็นให้น้องๆ โรงเรียนตำรวจตระเวนชายแดน', 'สร้างความรู้สึกอิ่มเอมใจพร้อมแบ่งปันกับการเป็นผู้ให้ เมื่อเครื่องสำอางบีเอสซี คอสเมโทโลจี จับมือ ฮีส แอนด์ เฮอร์ พลัส พอยท์ โดยบริษัท ไอ.ซี.ซี.อินเตอร์เนชั่นแนล จำกัด (มหาชน) จัดกิจกรรมซีเอสอาร์ร่วมบริจาคเสื้อผ้า สิ่งของที่จำเป็น เครื่องอุปโภคบริโภค ข้าวสาร อาหารแห้ง อุปกรณ์การเรียน ขนมและของเด็กเล่น มอบให้น้องๆ ผู้ยากไร้และช่วยเหลือครอบครัวในถิ่นทุรกันดาร ซึ่งเป็นโครงการที่ทำต่อเนื่องมาตลอดทุกปี พร้อมพาลูกค้าสร้างความประทับใจร่วมกัน ที่โรงเรียนตำรวจตระเวนชายแดนบ้านคีรีล้อม ต.ช้างแรก อ.บางสะพานน้อย จ.ประจวบคีรีขันธ์ เมื่อวันก่อน \r\nโดยครั้งนี้เราเดินทางไปที่โรงเรียนตำรวจตระเวนชายแดนบ้านคีรีล้อม ซึ่งอยู่ในภูเขาลึกมากๆ เป็นโรงเรียนขนาดเล็กมีนักเรียนทั้งหมดประมาณ 120 คน ซึ่งในครั้งนี้เราได้จัดเตรียมอุปกรณ์ สื่อการเรียนการสอน ทุนการศึกษา เสื้อผ้า ข้าวสาร อาหารแห้ง รวมไปถึงสิ่งขาดไม่ได้สำหรับเด็กๆ คือ ของเล่น ขนมและไอศกรีม ไปมอบให้ถึงมือเด็กๆ ซึ่งเด็กๆ จะดีใจเป็นอย่างมากทุกครั้งที่ได้รับ นอกจากนี้พี่ๆ ยังได้มอบความสุขด้วยกิจกรรมนันทนาการ เล่นเก่มร่วมกับเด็กมีความสุขเป็นอย่างมาก สุขทั้งผู้ให้และผู้รับ', , '2017-03-12 17:24:25');
INSERT INTO `news` (`Nid`, `nameNews`, `Detail`, `Pic`, `Date`) VALUES
(3, 'เปลี่ยน ‘รองเท้า’ เป็นทุนการศึกษาให้น้อง', '       บริจาครองเท้าใช้แล้วที่มีสภาพดี เพื่อเปลี่ยนเป็นทุนการศึกษาแก่น้องที่ขาดแคลนทุนทรัพย์ ผ่านร้านปันกัน\r\nต้อนรับเดือนแห่งความรัก ด้วยการจุดประกายการแบ่งปันภายใต้โครงการ “โรบินสันทำดี” ที่ห้างสรรพสินค้าโรบินสันจัดขึ้น โดยเชิญชวนนักช็อปรวมพลังส่งต่อความรักกับกิจกรรม“แชร์ ยัวร์ ชูส์” ในแคมเปญ “โรบินส์ ออน ชูส์ ปี 2” ด้วยการบริจาครองเท้าใช้แล้วที่มีสภาพดี เพื่อเปลี่ยนเป็นทุนการศึกษาแก่น้องที่ขาดแคลนทุนทรัพย์ ผ่านร้านปันกัน โดยมูลนิธิยุวพัฒน์ ตั้งแต่วันนี้-5 มีนาคมนี้ ที่โรบินสัน ดีพาร์ทเมนท์ สโตร์ และโรบินสันไลฟ์สไตล์ สาขาที่ร่วมรายการ \r\n       ทั้งนี้ภายในงานได้รับเกียรติจาก 3 เซเลบริตี้ ที่งานนี้ขอร่วมทำบุญด้วยการขนรองเท้าคู่ใจมาร่วมบริจาคในกิจกรรมดีๆ นี้รวมทั้งช็อปรองเท้าคู่ใหม่ในแคมเปญ “โรบินส์ ออน ชูส์ ปี 2" เริ่มที่เซเลบสาวหวาน “มายด์” แพรวปรียา ชุมพล ณ อยุธยา ที่บอกว่า ปกติเป็นคนชอบซื้อรองเท้ามากจนกลายเป็นของสะสม วันนี้ก็เลยถือโอกาสมามองหารองเท้าถูกใจ เพื่อร่วมทำบุญกับมูลนิธิขาเทียมของสมเด็จย่า และนำรองเท้ามาบริจาคในกิจกรรมด้วย เพราะเชื่อว่าน้ำใจจาก 1 คนรวมกัน จะกลายเป็นฝันที่ยิ่งใหญ่ของน้องๆ', , '2017-03-12 17:31:20');
INSERT INTO `news` (`Nid`, `nameNews`, `Detail`, `Pic`, `Date`) VALUES
(4, 'ไถ่ชีวิตโค', 'บ.ไทยประกันชีวิต จำกัด (มหาชน) ร่วมบริจาคเงินไถ่ชีวิตโค จำนวน 36 ตัว เนื่องในโอกาสวันคล้ายวันก่อตั้งบริษัทฯ ครบ 75 ปี \r\n      \r\n\r\n          นายไชย ไชยวรรณ กรรมการผู้จัดการใหญ่ บริษัท ไทยประกันชีวิต จำกัด (มหาชน) พร้อมด้วยผู้บริหาร พนักงาน และฝ่ายขาย ร่วมบริจาคเงินเพื่อไถ่ชีวิตโค จำนวน 36 ตัว เนื่องในโอกาสวันคล้ายวันก่อตั้งบริษัทฯ ครบ 75 ปี ให้แก่นายอำนวย ธรรมลังกา ปศุสัตว์อำเภอเมืองปทุมธานี โดยบริษัทฯ จะนำไปมอบให้กับโครงการธนาคารโค - กระบือ เพื่อเกษตรกรตามพระราชดำริ กรมปศุสัตว์ต่อไป ณ โรงฆ่าสัตว์ เทศบาลเมืองปทุมธานี จ.ปทุมธานี', , '2017-03-12 17:54:00');

